    const [open, setOpen] = React.useState(false);
    const handleClickCard = () => {
        setOpen(true);
    };

    return (
        <>
            <FormDialog open={open} setOpen={setOpen} idvoto={props.idvoto} eleitor={props.eleitor} senador={props.senador} category={props.category} listCard={props.listCard} setListCard={props.setListCatd}/>
            <div className="card--container"/* onClick={() => handleClickCard()}*/>
                <h1 className="card--tittle">{props.eleitor}</h1>
                <p className="card--senador">{props.senador}</p>
                <p className="card--presidente">{props.presidente}</p>
            </div>
        </>
    ) 
}
